import React from "react";
import "./App.css";
import { expensesList } from "./Components/Expenses/ExpensesList";
import Expenses from "./Components/Expenses/Expenses";
import NewExpense from "./Components/NewExpense/NewExpense";

function App() {

  const saveExpenseDataHandler = (enteredExpenseDataFromNewExpense) => {
    const expenseFromFormData = {
      ...enteredExpenseDataFromNewExpense
    };
    console.log(expenseFromFormData);
  };

  return (
    <div className="App">
      <h1>Expense Manager</h1>
      <NewExpense onSaveExpenseData={saveExpenseDataHandler}/>
      <Expenses items={expensesList} />
    </div>
  );
}

export default App;
